css:
.nuclide-ui-date-selector.nuclide-ui-dropdown-date-selector {
  position: absolute;
  z-index: 100;
}
.nuclide-ui-date-selector .dp-months,
.nuclide-ui-date-selector .dp-years {
  display: flex;
  flex-wrap: wrap;
  padding: 10px;
}
.nuclide-ui-date-selector .dp-cal-month,
.nuclide-ui-date-selector .dp-cal-year,
.nuclide-ui-date-selector .dp-day,
.nuclide-ui-date-selector .dp-month,
.nuclide-ui-date-selector .dp-year {
  background: transparent;
  border: 0;
  position: relative;
}
.nuclide-ui-date-selector .dp-cal-month,
.nuclide-ui-date-selector .dp-cal-year {
  font-size: 1.1em;
  padding: 10px;
}
.nuclide-ui-date-selector .dp-cal-header {
  position: relative;
  text-align: center;
}
.nuclide-ui-date-selector .dp-next,
.nuclide-ui-date-selector .dp-prev {
  background: transparent;
  border: 0;
  height: 100%;
  padding: 10px;
  position: absolute;
}
.nuclide-ui-date-selector .dp-next:focus,
.nuclide-ui-date-selector .dp-prev:focus,
.nuclide-ui-date-selector .dp-next:hover,
.nuclide-ui-date-selector .dp-prev:hover {
  color: inherit;
}
.nuclide-ui-date-selector .dp-prev {
  left: 0;
}
.nuclide-ui-date-selector .dp-next {
  right: 0;
}
.nuclide-ui-date-selector .dp-day-today:after {
  border: 0.5em solid #9da5b4;
  border-bottom-color: transparent;
  border-left-color: transparent;
  content: '';
  position: absolute;
  right: 0;
  top: 0;
}
.nuclide-ui-date-selector .dp-col-header,
.nuclide-ui-date-selector .dp-day {
  display: inline-block;
  padding: 10px;
  text-align: center;
  width: 14.28571429%;
}
.nuclide-ui-date-selector .dp-col-header {
  font-size: 0.8em;
  padding: 10px 0;
  text-transform: uppercase;
}
.nuclide-ui-date-selector .dp-month {
  flex-grow: 1;
  padding: 10px;
  width: 33%;
}
.nuclide-ui-date-selector .dp-year {
  padding: 10px;
  width: 100%;
}
.nuclide-ui-date-selector .dr-in-range,
.nuclide-ui-date-selector .dr-selected,
.nuclide-ui-date-selector .dp-months .dp-current,
.nuclide-ui-date-selector .dp-years .dp-current {
  background: #4d78cc;
  color: #ffffff;
}
.nuclide-ui-date-selector .dr-cals {
  background: #21252b;
  border: 1px solid #181a1f;
  border-radius: 3px;
  height: calc(16 * 10px + 12em);
  overflow: scroll;
  width: 26em;
}
.nuclide-ui-date-selector .dp-edge-day {
  visibility: hidden;
}
.nuclide-ui-date-selector .dp-cal-footer,
.nuclide-ui-date-selector .dr-cal-end {
  display: none;
}
.nuclide-ui-date-selector .dp {
  border: 0;
}
.nuclide-ui-date-selector .dp-day-disabled,
.nuclide-ui-date-selector .dp-day-disabled:focus,
.nuclide-ui-date-selector .dp-day-disabled:hover {
  background: transparent;
  color: rgba(157, 165, 180, 0.6);
  cursor: default;
}
